import React from 'react';
import FooterData from './footer_data';

class Foter extends React.Component{
  render(){
    return(
      <div id="footer" className="container-fluid">
        <div className="row">
          <div className="col-sm-4">
              {FooterData.map((item)=>{
                return(
                  (("link" in item)==1)?
                  <div className="card">
                    <div class="card-body">
                      <a className="navbar-brand col-3" href={item.url}>
                        <img src={item.img} alt="logo"/>
                      </a>
                        <h5>{item.title}</h5>
                        <ul className={item.ulClass}></ul>
                    </div>
                  </div>
              :
                null
                )
              }
              )}

          </div>
        </div>
      </div>
    )
  }
}
export default Foter
